import React from 'react';

const kumaraIcon = () => {
  return (
    <span role="img" aria-label="kumara">
      🍠
    </span>
  );
};

const Kumara = () => {
  return (
    <span id="navbar-heading" className="navbar-brand mb-0 h1">
      {kumaraIcon()}
      Rotten
      {` `}
      <span>
        <s>Tomatoes</s>
      </span>
      {` `}
      Kūmara
      {kumaraIcon()}
    </span>
  );
};

export default Kumara;
